import React from "react";

const About = () => {
  return (
    <div name="about" className="w-full h-screen bg-[#0a192f] text-grey-300">
      <div className="flex-col justify-center items-center w-full h-full">
        <div className="max-w-[1000px] w-full px-4 grid-cols-2 gap-8">
          <div>
            <p>About</p>
          </div>
          <div></div>
        </div>
      </div>
    </div>
  );
};

export default About;
